VALUES ('3560070274024', 'Crevettes sauvages entieres crues, 10/15 pieces', 'tropicale rose [Penaeus indicus ou Metapenaeus monoceros (B)*, pêchée au chalut en Océan indien (Zone FAO 51), antioxydant : disulfite de sodium. * voir lettre indiquée à côté du numéro de lot Ingrediënten: Roze tropische garnaal [Penaeus indicus of Metapenaeus monoceros (B)*, gevangen in de Indische Oceaan (Zone FAO 51), antioxidant: e @Conseil de préparation : A l\'eau : Plongez les crevettes dans une casserole d\'eau salée portée à ébullition. Laissez cuire 3 minutes. Au four : Préchauffez votre four à 2400C (Th.8) environ 10 minutes. Disposez les crevettes dans un plat allant au four. Badigeonnez-les d\'huile d\'olive et laissez-les cuire 8 à 10 minutes en les retournant de temps en temps. A la poêle : Après décongélation, faites saisir les crevettes dans un peu d\'huile d\'olive 5 minutes à feu vif en les retoumant de temps en temps. Au barbecue : Après décongélation, faites saisir les crevettes environ 4 minutes en les retournant à mi-temps. Nous vous déconseillons la cuisson au four à micro-ondes . Précautions d\'emploi : Avant toute utilisation, rincez les crevettes sous l\'eau froide e) égouttez-les. Conservation : A conserver 24 heures au réfrigérateur, 3 jours dans le compartiment à glace du réfrigérateur, plusieurs mois à -180C dans un congélateur*** et à consommer de préférence avant la date indiquée sur le côté de la boîte. ATTENTION, NE PAS RECONGELER APRÈS DÉCONGÉLATION. @ Bereidingsadvies : ln water : Leg de garnalen in een pan met kokend gezouten water. Laat 3 minuten koken. ln de oven : Verwarm uw oven ongeveer 10 minuten voor op 2400C (Th.8). Leg de garnalen in een ovenschotel. Smeer ze in met olijfolie en laat ze 8 à 10 minuten bakken. Draai ze af en toe om. ln de braadpan : Braad de gamalen na ontdooiing 5 minuten aan in een beetje olijfolie op een hoog vuur en draai ze af en toe om. Op de barbecue : Braad de garnalen na ontdooiing ongeveer 4 minuten aan en draai ze halverwege de baktijd om. Bakken in de microgolfoven wordt afgeraden. Voorzorgen bij gebruik : Spoel de garnalen véôr gebruik onder koud water en laat ze uitlekken. Bewaring: Bewaart 24 uur in de koelkast, 3 dagen in het vriesvak van de koelkast, meerdere maanden op -180C in een diepvriezer*** en ten minste houdbaar tot de datum vermeld op de zijkant van de doos. NA ONTDOOIING NIET OPNIEUW INVRIEZEN.', '0.8', '0.3', '4', '2.8', '', '24', '0.64', '0.251968503937008', '', '1');

