el en droog bewaren. Eens geopend, in de khelkast bewaren en binnen 5 dagen consumeren. Ten minste houdbaar tot: zie datum verpakkinp?', '6', '3.7', '49', '7', '6.1', '1.9', '1.4', '0.551181102362205', '', '0');

